import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import LoadingSpinner from '../shared/LoadingSpinner';
import ErrorMessage from '../shared/ErrorMessage';

const AboutSection = () => {
  const [aboutData, setAboutData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchAboutData = () => {
      try {
        setLoading(true);
        // Get about data from localStorage
        const storedAboutData = JSON.parse(localStorage.getItem('aboutDatabase'));

        if (storedAboutData) {
          setAboutData(storedAboutData);
        } else {
          // Default data if nothing is in localStorage
          setAboutData({
            title: 'About GradWay',
            description1: 'We are a team of dedicated education consultants with years of experience in helping students achieve their academic dreams. Our mission is to provide personalized guidance and support throughout your educational journey.',
            description2: 'With a proven track record of successful placements and satisfied students, we take pride in our comprehensive approach to education consulting. We understand that each student is unique, and we tailor our services to meet your specific needs and goals.',
            image: 'https://images.unsplash.com/photo-1522202176988-66273c2fd55f?ixlib=rb-4.0.3',
            yearsExperience: 10,
            learnMoreButtonText: 'Learn More About Us',
            learnMoreButtonLink: '/about',
            contactButtonText: 'Contact Us',
            contactButtonLink: '/contact'
          });
        }
        setLoading(false);
      } catch (err) {
        console.error('Error fetching about data:', err);
        setError('Failed to load about section');
        setLoading(false);
      }
    };

    // Initial fetch
    fetchAboutData();

    // Set up storage event listener to detect changes from other tabs/windows
    const handleStorageChange = (e) => {
      if (e.key === 'aboutDatabase') {
        console.log('About database updated, refreshing...');
        fetchAboutData();
      }
    };

    window.addEventListener('storage', handleStorageChange);

    // Poll for changes every 2 seconds (as a backup for changes in the same tab)
    const intervalId = setInterval(fetchAboutData, 2000);

    // Cleanup
    return () => {
      window.removeEventListener('storage', handleStorageChange);
      clearInterval(intervalId);
    };
  }, []);

  if (loading) {
    return (
      <section className="py-20">
        <div className="container mx-auto px-4 text-center">
          <LoadingSpinner />
        </div>
      </section>
    );
  }

  if (error) {
    return (
      <section className="py-20">
        <div className="container mx-auto px-4 text-center">
          <ErrorMessage message={error} />
        </div>
      </section>
    );
  }

  // If no about data is available, don't render anything
  if (!aboutData) return null;

  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
          {/* Image */}
          <div className="relative">
            <div className="aspect-w-4 aspect-h-3 rounded-lg overflow-hidden">
              <img
                src={aboutData.image}
                alt="Team meeting"
                className="w-full h-full object-cover"
              />
            </div>
            <div className="absolute -bottom-6 -right-6 bg-navy text-white p-6 rounded-lg shadow-lg">
              <div className="text-3xl font-bold">{aboutData.yearsExperience}+</div>
              <div className="text-sm">Years of Experience</div>
            </div>
          </div>

          {/* Content */}
          <div>
            <h2 className="text-3xl md:text-4xl font-bold text-navy mb-6">
              {aboutData.title}
            </h2>
            <p className="text-gray-600 mb-6">
              {aboutData.description1}
            </p>
            <p className="text-gray-600 mb-8">
              {aboutData.description2}
            </p>
            <div className="flex flex-col sm:flex-row gap-4">
              <Link
                to={aboutData.learnMoreButtonLink || "/about"}
                className="px-8 py-3 bg-navy text-white font-semibold rounded-md hover:bg-navy-light transition-colors text-center"
              >
                {aboutData.learnMoreButtonText || "Learn More About Us"}
              </Link>
              <Link
                to={aboutData.contactButtonLink || "/contact"}
                className="px-8 py-3 border-2 border-navy text-navy font-semibold rounded-md hover:bg-navy/5 transition-colors text-center"
              >
                {aboutData.contactButtonText || "Contact Us"}
              </Link>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default AboutSection;
